import React from "react";
import Playercards from "./Playercards";
import Agents from "./Agents";
import Maps from "./Maps";
import Weapons from "./Weapons";
import Home from "./Home";

function Navbar(){

    return <div id="navBar">

        <div id="mainContent">
            <Home/>
        </div>


        <ul id="bar">
            <li onClick={changeContentAgents}>Agents</li>
            <li onClick={changeContentCards}>Cards</li>
            <li onClick={changeContentHome}>Home</li>
            <li onClick={changeContentWeapons}>Weapons</li>
            <li onClick={changeContentMaps}>Maps</li>
        </ul>
        </div>

}

function changeContentAgents() {
    document.getElementById("mainContent").innerHTML = <Agents/>
}

function changeContentCards() {
    document.getElementById("mainContent").innerHTML = <Playercards/>
}

function changeContentHome() {
    document.getElementById("mainContent").innerHTML = <Home/>
}

function changeContentWeapons() {
    document.getElementById("mainContent").innerHTML = <Weapons/>
}

function changeContentMaps() {
    document.getElementById("mainContent").innerHTML = <Maps/>
}



export default Navbar
